import React from 'react';

const urlAPI = 'https://api.pokemontcg.io/v1/cards';

export default function listing() {
    
    try {
        fetch(urlAPI)
            .then(response => {
                if (!response.ok) {
                    throw new Error();
                }
                return response.json();
            });
            
    } catch {
        throw new Error('Something went wrong')
    };
};
